import React from 'react';
import Ingredient from "./Ingredient"
import "./IngredientsClasses.scss"

const burgerPreview = ( props ) => {
    const ingredientList = ["topBun", "bottomBun"];
    return (
      <div className="burger-preview-wrapper">
          <Ingredient ingredient="topBun"/>
          <Ingredient ingredient="lettuce"/>
          <Ingredient ingredient="onion"/>
          <Ingredient ingredient="tomato"/>
          <Ingredient ingredient="cucumber"/>
          <Ingredient ingredient="meat"/>
          <Ingredient ingredient="bottomBun"/>
      </div>
    );
};

export default burgerPreview;
